import React from 'react';

const CarouselItem = ({bgUrl, n}) => {
    return (
      <div
        className="carousel-item"
        style={{
            backgroundImage: `url(${bgUrl})`,
            width: `${100 / n - 1}%`
        }}
      ></div>
    );
}

export default CarouselItem;
